document.addEventListener("DOMContentLoaded", function() {

	createElement();
	createEventListener();
});

var ogg = {

   	prefix: "data:audio/ogg;base64,",
	ding: "",
	slide: "",
	space: "",
	click: ""
};

function playAudio(sound) {

	if (sound === "ding") {
		ding.currentTime = 0;
		ding.play();
	} else if (sound === "slide") {
		slide.currentTime = 0;
		slide.play();
	} else if (sound === "space") {
		space.currentTime = 0;
		space.play();
	} else if (sound === "click") {
		click.currentTime = 0;
		click.play();
	}
};

function createElement() {

	var typewriter = document.createElement("div");
		typewriter.id = "typewriter";
   		document.getElementsByTagName("body")[0].appendChild(typewriter);

	var ding = document.createElement("audio");
		ding.id = "ding";
		ding.src = ogg.prefix + ogg.ding;
		document.getElementById("typewriter").appendChild(ding);

	var slide = document.createElement("audio");
		slide.id = "slide";
		slide.src = ogg.prefix + ogg.slide;
		document.getElementById("typewriter").appendChild(slide);

	var space = document.createElement("audio");
		space.id = "space";
		space.src = ogg.prefix + ogg.space;
		document.getElementById("typewriter").appendChild(space);

	var click = document.createElement("audio");
		click.id = "click";
		click.src = ogg.prefix + ogg.click;
		document.getElementById("typewriter").appendChild(click);
}

function createEventListener() {

	var inputTag = document.getElementsByTagName("input");

    	for (var i=0;i<inputTag.length;i++) {
		inputTag[i].addEventListener("keyup", function(event) {
			if (event.keyCode === 9) {
				playAudio("ding");
			} else if (event.keyCode === 32) {
				playAudio("space");
			} else {
				playAudio("click");
			}
		});
	 }

	var textareaTag = document.getElementsByTagName("textarea");

	for (var i=0;i<textareaTag.length;i++) {
		textareaTag[i].addEventListener("keyup", function(event) {
			if (event.keyCode === 9) {
				playAudio("ding");
			} else if (event.keyCode === 13) {
				playAudio("slide");
			} else if (event.keyCode === 32) {
				playAudio("space");
			} else {
				playAudio("click");
			}
		});
	}
}
